const Navbar = styled.div`
    display: flex;
    padding: 1rem;
    justify-content: flex-end;
    align-items: center;
    margin-bottom: 3rem;    
`
const Nav = () => {
    return (
        <div>
            <Navbar></Navbar>
        </div>
    )
}

export default Nav
